import "../App.css";
import Links from "./Links";
import Videos from "./Videos";
function Main() {
	return (
		<div className="Main">
			<section>
				<Links lnk="www.google.com"></Links>
				<Links lnk="www.youtube.com"></Links>
			</section>
			<section>
				<Videos></Videos>
			</section>
		</div>
	);
}
export default Main;
